I have add lspinstall plugin to help simplify the language server installation. You can use :LspInstall command to install the server you want. You can also use the :LspInstallInfo to use a panel to manage the servers. The plugin will ensure CPP/Lua/Golang/Rust [1] lanaguge servers are installed. You can add or delete those ensure installed server in the lua/config/lsp.lua file. Use the / to find the ensure_installed_server variable. -- add yours or delete in this variable
local ensure_installed_server = { "clangd", "gopls", "sumneko_lua",
} Rust server is set up by rust-tools.nvim. For detail please read Rust.md(WIP)
